import './head.css';
import logo from '../../assets/other/logo.png';

function Head(){



    return(
        <div className='head'>
            <div className='head-top'>
                <img src={logo} alt='Cyberpunk' />
                <div className='menu'>
                    <div className='menu-item'>
                        <div className='menu-item-shape'>
                             COMMUNITY
                        </div>
                    </div>
                </div>
            </div>
            <div className='banner-video'></div>
        </div>
    )
}
export default Head;
